import React from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

function Admin() {
  return (
    <div className='container'>
    <Box
      component="form"
      sx={{
        // m: "auto", width: '45ch',p:"15px" ,
        '& > :not(style)': { display:"flex",justifyContent:"center",marginBottom:"30px",color:"red"},
        
      }}
      
      noValidate
      autoComplete="off"
    >
     <h4>fill product details</h4>
      <TextField id="filled-basic" name="rname" label="Restaurant name" variant="filled"  InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="imgdata" label="Image Address" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="address" label="Tag" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="delimg" label="delimg" value="https://b.zmtcdn.com/data/o2_assets/0b07ef18234c6fdf9365ad1c274ae0631612687510.png?output-format=webp" variant="filled" InputLabelProps={{style: { color: 'red' }}} disabled/>
      <TextField id="filled-basic" name="somedata" label="orders placed text" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name='price' label="price" variant="filled" InputLabelProps={{style: { color: 'red' }}} />
      <TextField id="filled-basic" name="rating" label="rating" variant="filled" InputLabelProps={{style: { color: 'red' }}}/>
      <TextField id="filled-basic" name="arrimg" value="https://b.zmtcdn.com/data/o2_assets/4bf016f32f05d26242cea342f30d47a31595763089.png?output-format=webp" label="arrimg" variant="filled" InputLabelProps={{style: { color: 'red' }}} disabled />
      <Button variant="contained" type='submit'>Submit</Button>
    </Box>
    </div>
  )
}

export default Admin
